import React from 'react';
import {Container, Status, Main} from './styles'

const RocketCard = () => {
  return (
    <Container>
      <Main>
        <div>
          <figure><img src={'./images/falcon.webp'}/></figure>
        </div>
        <div></div>
      </Main>
      <Status><p>status: active</p></Status>
    </Container>
  );
};

export default RocketCard;
